  def psedata(pseDatas: Seq[PSEData], dimensionName: DimensionName) = pseDatas.filter(_.dimension.name == dimensionName).head

  def ee = {

    def e0(tank: Seq[Int], acc: Seq[Double]): Seq[Double] = {
      if (tank.isEmpty) Seq.fill(10)(0.0) ++ acc.reverse
      else e0(tank.tail, acc ++ Seq.fill(10)(s"0.${tank.size}".toDouble))
    }

    e0((0 to 8).toSeq, Seq())
  }


  def ff = {
    for {
      a <- (0 to 10)
      b <- (0 to 10)
      c <- (0 to 10)
    } yield {
      (a.toDouble / 10, b.toDouble / 10, c.toDouble / 10)
    }
  }

  val idealPSE = Map(
    "area" -> ff,
    "compacity" -> ff,
    "convexity" -> ff
  )

  def integerNCube(n: Int, p: Int, hollow: Boolean = false): Seq[Seq[Int]] = {
    val pointGenerator = Array.fill[Int](n)(p-1)
    val points = for(_ <- 1 to math.pow(p, n).toInt) yield {
      pointGenerator(0) += 1
      for(i <- 0 until n if pointGenerator(i) == p) {
        pointGenerator(i) = 0
        if(i + 1 < n) pointGenerator(i + 1) += 1
      }
      pointGenerator.toSeq
    }
    if(hollow) {
      points.filter(v => v.contains(0) || v.contains(p - 1))
    } else {
      points
    }
  }

  def normalizedNCube(n: Int, p: Int, hollow: Boolean = false): Seq[Seq[Double]] = {
    integerNCube(n, p, hollow).map(_.map(_.toDouble / (p - 1)))
  }

  def centeredNCube(n: Int, p: Int, hollow: Boolean = false): Seq[Seq[Double]] = {
   normalizedNCube(n, p, hollow).map(sub(Seq.fill(n)(0.5))).map(scale(2))
  }

  private def reverse(normalSpacePoints: Seq[Seq[Double]]) = {
    val dimension = normalSpacePoints.head.length
    normalSpacePoints.map(negate).map(_ + Seq.fill(dimension)(1))
  }
  def lowCorner(n: Int, p: Int): Seq[Seq[Double]] = normalizedNCube(n, p, hollow = true).filter(_.contains(0))
  def highCorner(n: Int, p: Int): Seq[Seq[Double]] = reverse(lowCorner(n, p))
  def highSphericalCorner(n: Int, p: Int): Seq[Seq[Double]] = RestrictedSpaceTransformation4.fromSquareToCircle(highCorner(n, p))//.map(cellRadialAdjustment(Geometry.cubic, _)).map(Vectors.normalize)
  def lowSphericalCorner(n: Int, p: Int): Seq[Seq[Double]] = reverse(highSphericalCorner(n, p))

  def limitAngle(normalSpacePoints: Seq[Seq[Double]]): Seq[Seq[Double]] = {
    val dimension = normalSpacePoints.head.length
    val middleDirectionVector = Seq.fill(dimension)(1.0)
    val maxAngle = middleDirectionVector angle (Seq(0.0) ++ Seq.fill(dimension - 1)(1)) // zero if dimension is infinite
    normalSpacePoints.filter(v => (v angle middleDirectionVector) <= maxAngle)
  }
  def lowSphericalCornerLimitedAngle(n: Int, p: Int): Seq[Seq[Double]] = reverse(limitAngle(highSphericalCorner(n, p)))

